        public string GenerateName()
        {
            var random = new Random(Guid.NewGuid().GetHashCode());
            var useEnglishName = random.Next(1, 10) % 2 == 0;
           
            var firstName = useEnglishName ? _engFirstNames : _chFirstNames;
            var lastName = useEnglishName ? _engLastNames : _chLastNames;

            return string.Concat(firstName[random.Next(0, firstName.Length - 1)],
                useEnglishName ? " " : "",
                lastName[random.Next(0, lastName.Length - 1)]);
        }


